import React from "react";
import PropTypes from "prop-types";
import withStyles from "@material-ui/core/styles/withStyles";
import Grid from "@material-ui/core/Grid";
import clsx from "clsx";
import Typography from "../Typography";
import Button from "../Button";
import Box from "../Box";
import { styles } from "./styles";

const PriceFixed = ({
    classes,
    dailyPrice,
    totalDays,
    totalPrice,
    onClick,
    suffix,
    prefix,
    className,
    labelButton,
}) => {
    return (
        <Box className={clsx(classes.root, className)}>
            <Grid container>
                <Grid item xs={6}>
                    <Typography className={classes.currency} type="body2semibold">
            R$
                    </Typography>
                    <Typography className={classes.price} type="headline3">
                        {dailyPrice}
                    </Typography>{" "}
                    <Typography type="captionregular">/ {prefix}</Typography>
                    <Typography className={classes.totalPrice} type="captionregular">
                        {totalDays} {suffix}{" "}
                        <Typography className={classes.hotel} type="captionsemibold">
              R$ {totalPrice}
                        </Typography>
                    </Typography>
                </Grid>
                <Grid item xs={6}>
                    <Button
                        className={classes.btn}
                        color="primary"
                        label={labelButton}
                        variant="contained"
                        size="medium"
                        fullWidth
                        onClick={onClick}
                    />
                </Grid>
            </Grid>
        </Box>
    );
};

PriceFixed.propTypes = {
    classes: PropTypes.object.isRequired,
    totalPrice: PropTypes.oneOfType([PropTypes.number, PropTypes.string])
        .isRequired,
    dailyPrice: PropTypes.oneOfType([PropTypes.number, PropTypes.string])
        .isRequired,
    totalDays: PropTypes.oneOfType([PropTypes.number, PropTypes.string])
        .isRequired,
    onClick: PropTypes.func.isRequired,
};

export default withStyles(styles, { withTheme: true })(PriceFixed);
